import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Component/Navbar";
import SlideBoard from "./Component/SlideBoard";
import MainMenuContainer from "./Component/MainMenuContainer";
import MainContainer from "./Component/MainContainer";
import MainCard from "./Component/MainCard";
import { useState } from "react";
import NavbarUser from "./Component/NavbarUser";
import NUTest from "./Component/NUTest";

function App() {
  let [stateCard, setStateCard] = useState("chcch123");

  var offcanvasElementList = [].slice.call(
    document.querySelectorAll(".offcanvas")
  );
  var offcanvasList = offcanvasElementList.map(function (offcanvasEl) {
    return new bootstrap.Offcanvas(offcanvasEl);
  });
  return (
    <div className="App">
      <Navbar />
      <NUTest />
      <SlideBoard />
      <MainMenuContainer />
      <MainContainer />
      <MainCard stateCard={stateCard} />
    </div>
  );
}

export default App;
